import React from 'react'

function HomeRoute() {
  return (
    <div className='h-screen w-full bg-[#067480]'>
      <div className='w-full  flex justify-center'>
        <h1 className='text-4xl bold'>Todo List</h1>
      </div>
    </div>
  )
}

export default HomeRoute
